"""
This code for dividing the dataset using the scafold method
Code adapted from TransFoxMol model
https://github.com/gaojianl/TransFoxMol/blob/main/TFM/utils.py
This model comes from the paper:
Gao, J., Shen, Z., Xie, Y., Lu, J., Lu, Y., Chen, S., â€¦ Dong, X. (2023). TransFoxMol:
 Predicting molecular property with focused attention. Briefings in Bioinformatics, 24.
 https://doi.org/10.1093/bib/bbad306.
"""


import numpy as np
import pandas as pd
from rdkit import Chem
from rdkit.Chem.Scaffolds.MurckoScaffold import MurckoScaffoldSmiles



def scaffold_split(data, validrate=0.1, testrate=0.1,seed=426):

    lenth = len(data)
    print("dataset len is",lenth)

    train_inds, valid_inds, test_inds = [], [], []
    scaffolds = {}
    for ind, row in data.iterrows():
        smile = row['smiles']
        # smiles2mol
        mol = Chem.MolFromSmiles(smile)
        # Extracting molecular scaffolds, considering chirality
        scaffold = MurckoScaffoldSmiles(mol=mol, includeChirality=True)
        # Scaffolds are a dictionary, and if the scaffold is not in the dictionary, it is added and the index of the current molecule is recorded
        if scaffold not in scaffolds:
            scaffolds[scaffold] = [ind]
        # If the scaffold already exists, add the index of the current molecule to the corresponding list
        else:
            scaffolds[scaffold].append(ind)

    print(scaffolds)
    rng = np.random.RandomState(seed)
    print(rng)
    scaffold_list=np.array(list(scaffolds.values()), dtype=object)
    print(scaffold_list)
    #Rearrange array array elements
    scaffold_sets = rng.permutation(scaffold_list)
    print(scaffold_sets)
    # Size of validation set and test set
    n_total_valid = round(validrate * len(data))
    n_total_test = round(testrate * len(data))
    for scaffold_set in scaffold_sets:
        if len(valid_inds) + len(scaffold_set) <= n_total_valid:
            valid_inds.extend(scaffold_set)
        elif len(test_inds) + len(scaffold_set) <= n_total_test:
            test_inds.extend(scaffold_set)
        else:
            train_inds.extend(scaffold_set)

    return train_inds, valid_inds, test_inds

if __name__ == '__main__':
    data = pd.read_excel(r'../data/BBBP_rm.xlsx')
    train_inds,valid_inds,test_inds=scaffold_split(data)
    data['split'] = None
    data.loc[train_inds, 'split'] = 'train'
    data.loc[valid_inds, 'split'] = 'valid'
    data.loc[test_inds, 'split'] = 'test'
    #The split column of this file is messy
    # data.to_excel("../data/BBBP_useScaffold_confusion.xlsx", index=False)
    data['split'] = pd.Categorical(data['split'], categories=['train', 'valid', 'test'], ordered=True)
    # Sort by split column
    data = data.sort_values(by='split').reset_index(drop=True)
    data.to_excel("../data/BBBP_useScaffold.xlsx", index=False)


